import axios from "axios";

//상품 데이터 APi주소
const instance = axios.create({
    baseURL: 'https://panda-market-api.vercel.app/',
    timeout: 5000,
});

async function Api(params) {

    const res = await instance('/products', { params });

    return res.list;
}

export default Api;
